<template>
  <div :class="getClass(widgetObj)" @click="onSlideBoxClick(widgetObj)" style="z-index: '3'">
    <span
      :class="
        widgetObj.name === 'textTicker'
          ? 'slide-txt-btm-ticker'
          : 'slide-txt-btm'
      "
    >{{ widgetObj.properties.widgetName }}</span>
    <img :src="require('@/assets/images/transparent_image.jpg')" alt />
    <span class="delete" @click="(e) => handleDelete(e, widgetObj.key)">
      <i class="far fa-trash-alt"></i>
    </span>
    <span class="edit" v-if="widgetObj.isShown" @click="(e) => handleEdit(e, widgetObj)">
      <i class="far fa-edit"></i>
    </span>
    <img
      v-if="widgetObj.name === 'Image'"
      :src="require('@/assets/logo.png')"
      :width="width"
      :height="height"
    />
    <p
      class="simple-text"
      :style="textStyle"
      v-else-if="widgetObj.name === 'simpleText'"
    >{{ widgetObj.properties.content }}</p>

    <p
      class="simple-text"
      :style="textStyle"
      v-else-if="widgetObj.name === 'dateTime'"
    >{{ widgetObj.properties.content }}</p>

    <p
      class="simple-text"
      :style="textStyle"
      v-else-if="widgetObj.name === 'timer'"
    >{{ timerContent }}</p>

    <div
      class="ticker-text"
      :style="tickerStyle"
      v-if="widgetObj.name === 'textTicker'"
    >{{ widgetObj.properties.content }}</div>

    <div
      :class="
            widgetObj.properties.styleType ==='Light' ?  'scoreBoardwidgetLight' : 'scoreBoardwidgetDark'
          "
      v-if="
        widgetObj.name === 'scoreBoard'
      "
    >
      <div class="teamScoreBoard">
        <div class="teamName">
          <font>{{ this.widgetObj.properties.player1Name }}</font>
        </div>
        <div class="teamScore">
          <font>{{ this.widgetObj.properties.score1 }}</font>
        </div>
      </div>

      <div class="teamScoreBoard">
        <div class="teamName">
          <font>{{ this.widgetObj.properties.player2Name }}</font>
        </div>
        <div class="teamScore">
          <font>{{ this.widgetObj.properties.score2 }}</font>
        </div>
      </div>
      <div class="gameClock" v-if="this.widgetObj.properties.isGameClockEnabled">
        <font>{{ this.widgetObj.properties.content }}</font>
      </div>
    </div>

    <div :style="shapeStyle" v-if="widgetObj.name === 'rectangle'"></div>

    <div :style="shapeStyle" v-if="widgetObj.name === 'oval'"></div>
  </div>
</template>

<script>
import Helper from '@/common/helper.js';
export default {
  name: 'SlideBox',
  props: {
    widgetObj: Object,
    previewWidgets: Array
  },
  computed: {
    textStyle() {
      const { textShadows, textBorder } = this.widgetObj.properties;
      const txtShdwArr = textShadows.split(' ');
      const textShadowValue = `${txtShdwArr[0]}vw ${txtShdwArr[1]}vw ${txtShdwArr[2]}vw ${txtShdwArr[3]}`;
      const txtBorderArr = textBorder.split(' ');
      const textBorderValue = `${txtBorderArr[0]}vw solid ${txtBorderArr[2]}`;
      return {
        fontSize: `${this.widgetObj.properties.fontSize}px`,
        color: this.widgetObj.properties.fontColor ? this.widgetObj.properties.fontColor : 'transparent',
        backgroundColor: this.widgetObj.properties.paddingFill,
        padding: this.widgetObj.properties.paddingValue + 'vw',
        fontFamily: this.widgetObj.properties.fontType,
        fontWeight: this.widgetObj.properties.fontStyle,
        textShadow: this.widgetObj.isTextShadowEnabled ? textShadowValue : null,
        border: this.widgetObj.isTextBorderEnabled ? textBorderValue : null
      };
    },
    tickerStyle() {
      const { textShadows, textBorder } = this.widgetObj.properties;
      const txtShdwArr = textShadows.split(' ');
      const textShadowValue = `${txtShdwArr[0]}vw ${txtShdwArr[1]}vw ${txtShdwArr[2]}vw ${txtShdwArr[3]}`;
      const txtBorderArr = textBorder.split(' ');
      const textBorderValue = `${txtBorderArr[0]}vw solid ${txtBorderArr[2]}`;
      return {
        fontSize: `${this.widgetObj.properties.fontSize}px`,
        color: this.widgetObj.properties.fontColor ? this.widgetObj.properties.fontColor : 'transparent',
        backgroundColor: this.widgetObj.properties.paddingFill,
        padding: this.widgetObj.properties.paddingValue + 'vw',
        fontFamily: this.widgetObj.properties.fontType,
        fontWeight: this.widgetObj.properties.fontStyle,
        textShadow: this.widgetObj.isTextShadowEnabled ? textShadowValue : null,
        border: this.widgetObj.isTextBorderEnabled ? textBorderValue : null
      };
    },
    shapeStyle() {
      const { textShadows, textBorder } = this.widgetObj.properties;
      const txtShdwArr = textShadows.split(' ');
      const textShadowValue = `${txtShdwArr[0]}vw ${txtShdwArr[1]}vw ${txtShdwArr[2]}vw ${txtShdwArr[3]}`;
      const txtBorderArr = textBorder.split(' ');
      const textBorderValue = `${txtBorderArr[0]}vw solid ${txtBorderArr[2]}`;

      return {
        width: this.widgetObj.properties.width + '%',
        height: this.widgetObj.properties.height + '%',
        background: this.widgetObj.properties.fill,
        boxShadow: this.widgetObj.isTextShadowEnabled ? textShadowValue : null,
        border: this.widgetObj.isTextBorderEnabled && txtBorderArr[1] == 'center' ? textBorderValue : null,
        outline: this.widgetObj.isTextBorderEnabled && (txtBorderArr[1] == 'outside' || txtBorderArr[1] == 'inside') ? textBorderValue : null,
        outlineOffset: this.widgetObj.isTextBorderEnabled && txtBorderArr[1] == 'inside' ? `-${0.5 + parseInt(txtBorderArr[0])}vw` : null,
        borderRadius: this.widgetObj.name === 'oval' ? '50%' : null
      };
    }
  },
  data: function() {
    return {
      timerContent: ''
    };
  },
  mounted() {
    this.getTimerContent();
  },

  methods: {
    getClass(obj) {
      if (obj.isShown) {
        return 'slide-edit active';
      } else {
        return 'slide-edit';
      }
    },
    onSlideBoxClick(obj) {
      this.$emit('selectBox', obj);
    },
    handleDelete(e, _key) {
      e.stopPropagation();

      //deleting widget
      this.$emit('deleteWidget', _key);
    },
    handleEdit(e, obj) {
      e.stopPropagation();
      this.$emit('editWidget', obj);
    },
    getTimerContent() {
      this.timerContent = Helper.ConverttoHHMMSS(this.widgetObj.properties.timerStart, this.widgetObj.properties.timerFormat);
    }
  }
};
</script>
